import "./credits.css";
import {
    Link
  } from "react-router-dom";

const Credits = () => {
    return(
        <div>
            <div className="header">
                <h1>CREDITS</h1>
                <h3>Designed & Created</h3>
                <p>by <strong>JOEL LAKE</strong></p>
                <h3>Programming</h3>
                <p>by <strong>JOEL LAKE</strong> & <strong>HAI NGHIEM</strong></p>
            </div>
            
            <div className="homebtn">
                <Link to="/">
                    <button>
                        Go back!
                    </button>
                </Link>
            </div>    
        </div>
    )
}

export default Credits;
